import { useNavigate } from "react-router-dom";

export const Home = () => {
  const navigation = useNavigate();
  const onClickAdminButton = () => {
    console.log("管理者ボタンが押されました");
    navigation("/loginAdmin");
  };
  return (
    <div>
      <h1>TOPページ</h1>
      <button onClick={onClickAdminButton}>管理者の方はこちら</button>
      <br />
      <button>社員の方はこちら</button>
    </div>
  );
};
